import { View, Text } from 'react-native'
import React from 'react'
import Todo from './Todo';

const Todos = ({todos}) => {
  return (
    <View style={{
      width: 300,
      minHeight: 35,
      padding: '50',
      backgroundColor: 'pink',
      marginBottom: 10,
      borderRadius: 5,
    }}>

      {todos.map(todo => (
        <Todo todo={todo} key={todo.id}/>
      ))}
    </View>
  )
}

export default Todos;
